import React from 'react';
import '../styles/ProyectosRecientes.css';

const ProyectosRecientes = () => {
  const proyectos = [
    { nombre: "Sistema de Gestión", icono: "🛠️" },
    { nombre: "Aplicación Móvil", icono: "📱" },
    { nombre: "E-Commerce", icono: "🛒" },
    { nombre: "Portal Educativo", icono: "📚" },
    { nombre: "Dashboard Administrativo", icono: "📊" },
    { nombre: "Asistente Virtual", icono: "🤖" },
  ];

  return (
    <div className="proyectos-container">
      {/* Zona de IA */}
      <aside className="sidebar">
        <h2>Proyectos Recientes</h2>
        <div className="ia-section">
          <div className="ia-card">
            <img src="ruta_a_imagen_tiburon" alt="IA" />
            <p>Inteligencia Artificial (IA)</p>
          </div>
        </div>

        {/* Nueva sección significativa */}
        <div className="sidebar-info">
          <h3>Nuestra Misión</h3>
          <p>
            Crear soluciones innovadoras que transformen la tecnología en una herramienta accesible para todos.
          </p>
          <p>
            "Un paso hacia un futuro más inteligente y conectado."
          </p>
        </div>
      </aside>

      {/* Zona de proyectos */}
      <main className="proyectos-main">
        <div className="proyectos-grid">
          {proyectos.map((proyecto, index) => (
            <div key={index} className="proyecto-card">
              <div className="proyecto-icon">{proyecto.icono}</div>
              <p>{proyecto.nombre}</p>
            </div>
          ))}
        </div>
      </main>
    </div>
  );
};

export default ProyectosRecientes;
